<!DOCTYPE html>

<html>
  <head>
    <link href="http://fonts.googleapis.com/css?family=Nothing+You+Could+Do" rel="stylesheet" type="text/css">
    <link href="http://fonts.googleapis.com/css?family=Open+Sans" rel="stylesheet" type="text/css">
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <title>Snoo</title>
    <script async="" type="application/dart" src="snoo.dart"></script>
    <script async="" src="packages/browser/dart.js"></script>
    <link rel="stylesheet" href="snoo.css">
    <style type="text/css"></style><style type="text/css"></style>
  </head>
  <body>
    <span id="lvltex" class="text">Optimizing</span>
    <div id="split">
      <div id="upper"></div>
      <div id="lower"></div>
    </div>
    <span id="otext" class="text">Snoo the Terrible has eaten the Github Link!</span>
    <span id="stext" class="text">TEAR THAT THING TO PIECES</span>
    <div id="madeby">
      <span id="madetex">Made by <a href="http://gekorm.com">George Kormaris</a></span>
      <div id="overlay-outer" class="blurhue">
        <div id="overlay-inner">
          <div id="reddit-alien">
            <div id="antenna">
              <div class="dot"></div>
            </div>
            <div id="ear-left" class="ear"></div>
            <div id="ear-right" class="ear"></div>
            <div id="alien-head">
              <div id="eye-left" class="eye"></div>
              <div id="eye-right" class="eye"></div>
              <div id="mouth"></div>
            </div>
            <div id="arm-left" class="arm"></div>
            <div id="arm-right" class="arm"></div>
            <div id="alien-body"></div>
            <div id="foot-left" class="foot"></div>
            <div id="foot-right" class="foot"></div>
          </div>
        </div>
      </div>
    </div>
  </body>
</html>
